import React, {Component} from 'react';
import FlightComponent from "../reusable_components/FlightComponent";
import FlightServices from "../services/FlightServices";

class TestMainPage extends Component {

    constructor(props) {
        super(props);

        this.onComponentMount = this.onComponentMount.bind(this);
    }


    onComponentMount = (event) => {
        FlightServices.insertNewFlight(flight).then((response => {
            this.props.history.push('/flight/departure-flight');
            console.log(response.data)
        }))
    }

    render() {
        return (
            <div>
                <FlightComponent onCreateComponent={this.onComponentMount}/>
            </div>
        );
    }
}

export default TestMainPage;
